        if a == b:
            return None
        return a if a > b else b
    elif isinstance(a, (int, float)) and isinstance(b, (int, float)):
        return a if float(a) > float(b) else b
    elif isinstance(a, str) and isinstance(b, str):
        a = a.replace(',', '.')
        b = b.replace(',', '.')
        return a if float(a) > float(b) else b
    else:
        return a if str(a) > str(b) else b

def fix_spaces(text):
    result = ""
    count = 0
    for char in text:
        if char == " ":
            count += 1
            if count > 2:
                result = result[:-2] + "-"
                count = 1
            else:
                result += "_"
        else:
            result += char
            count = 0
    return result

def file_name_check(file_name):
    if file_name.count('.') != 1:
        return 'No'
    name, ext = file_name.split('.')
    if not name or not name[0].isalpha():
        return 'No'
    if ext not in ['txt', 'exe', 'dll']:
        return 'No'
    if sum(1 for c in name if c.isdigit()) > 3:
        return 'No'
    return 'Yes'

def is_prime(n):
    if n < 2:
        return False
    for i in range(2, int(n ** 0.5) + 1):
        if n % i == 0:
            return False
    return True

def words_in_sentence(sentence):
    def get_primes_up_to_n(n):
        primes = []
        for i in range(2, n+1):
            if is_prime(i):
                primes.append(i)
        return primes

    words = sentence.split()
    prime_lengths = get_primes_up_to_n(max(len(word) for word in words))
    result = [word for word in words if len(word) in prime_lengths]
    return ' '.join(result)

def specialFilter(nums):
    def is_odd_digit(num):
        return int(str(num)[0]) % 2 != 0 and int(str(num)[-1]) % 2 != 0

    count = 0
    for num in nums:
        if num > 10 and is_odd_digit(num):
            count += 1

    return count

def get_max_triples(n):
    count = 0
    for i in range(1, n+1):
        a_i = i * i - i + 1
        for j in range(i+1, n+1):
            a_j = j * j - j + 1
            for k in range(j+1, n+1):
                a_k = k * k - k + 1
                if (a_i + a_j + a_k) % 3 == 0:
                    count += 1
    return count

def bf(planet1, planet2):
    planets = ["Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"]
    if planet1 not in planets or planet2 not in planets:
        return ()
    start_idx = planets.index(planet1)
    end_idx = planets.index(planet2)
    if start_idx > end_idx:
        start_idx, end_idx = end_idx, start_idx
    return tuple(sorted(planets[start_idx+1:end_idx], key=lambda x: planets.index(x)))

